class Solution {
    func minWindow(_ source: String, _ target: String) -> String {
        let sourceCharArray = Array(source)
        var need = [Character: Int]()
        var window = [Character: Int]()
        
        // 组装结果表，先将每个字母有多少个写入need
        for char in target {
            if let tmp = need[char] {
                need[char] = tmp + 1
            } else {
                need[char] = 1
            }
        }
        
        print(need)
        
        // 左边起点
        var left = 0
        
        var right = 0

        // 有效计数
        var valid = 0
        
        // 开始点
        var start = 0
        // 截取长度，最小长度为target长度
        var length = Int.max
        
        // 减少获取次数
        let needChars = need.keys
        
        // swift while 循环的效率极其低下，所以这里改用for循环遍历
        for _ in 0..<source.count {
            // 拿出当前字符
            let char = sourceCharArray[right]
            // 扩大右窗口
            right += 1
            
            // 判断是否需要当前字符，如果需要，则进入滑动逻辑，如果不需要直接跳过
            let contains = needChars.contains(char)
            if contains {
                // 窗口计数增加
                if let tmp = window[char] {
                    window[char] = tmp + 1
                } else {
                    window[char] = 1
                }
                
                // 当前字符计数相等，有效+1
                if window[char] == need[char] {
                    valid += 1
                }
                
                
                // 找到了可行的子集，开始滑动收缩左窗口
                while valid == need.count {
                    // 找到最小length并记录start和length
                    if right - left < length {
                        start = left
                        length = right - left
                    }
                    
                    let deleteChar = sourceCharArray[left]
                    // 收缩左窗口
                    left += 1
                    
                    if needChars.contains(deleteChar) {
                        // 当前字符计数相等，有效-1,终止内层循环
                        if window[deleteChar] == need[deleteChar] {
                            valid -= 1
                        }
                        
                        // 终止内层循环后，外层循环向右扩大窗口，继续找
                        if let tmp = window[deleteChar] {
                            window[deleteChar] = tmp - 1
                        } else {
                            window[deleteChar] = -1
                        }
                    }
                }
            }
        }
        
        if length == Int.max || length < target.count {
            return ""
        } else {
            let startIndex = source.utf8.index(source.utf8.startIndex, offsetBy: start)
            let endIndex = source.utf8.index(startIndex, offsetBy: length)
            return String(source[startIndex..<endIndex])
        }
    }
}

Solution().minWindow("", "")
